import "./Settings.css";

function Settings() {
  return (
    <div className="Settings">
      <div className="container my-5">
        <h1>
          <span>
            <button className="btn btn-secondary">
              {" "}
              <span>&lt;</span> Back{" "}
            </button>{" "}
            Settings
          </span>
        </h1>

        <input type="text" className="form-control" placeholder="Search" />
      </div>
    </div>
  );
}

export default Settings;
